import { BrowserModule } from '@angular/platform-browser';
import { NgModule } from '@angular/core';
import { FormsModule, ReactiveFormsModule } from '@angular/forms';
import { HttpClientModule } from '@angular/common/http';
import { RouterModule } from '@angular/router';

import { AppComponent } from './app.component';
import { NavMenuComponent } from './nav-menu/nav-menu.component';
import { HomeComponent } from './home/home.component';
import { ProfileFormComponent } from './profileForm/profileForm.component';
import { PatientsComponent } from './patients/patients.component';
import { HealthcareProvidersComponent } from './healthcare-providers/healthcare-providers.component';
import { PatientUpdateComponent } from './patient-update/patient-update.component';
import { FetchDataComponent } from './fetch-data/fetch-data.component';
import { BrowserAnimationsModule } from '@angular/platform-browser/animations';
import { ToastrModule } from 'ngx-toastr';

@NgModule({
  declarations: [
    AppComponent,
    NavMenuComponent,
    HomeComponent,
    ProfileFormComponent,
    PatientsComponent,
    HealthcareProvidersComponent,
    PatientUpdateComponent,
    FetchDataComponent,
    BrowserAnimationsModule,
    ToastrModule
  ],
  imports: [
    BrowserModule.withServerTransition({ appId: 'ng-cli-universal' }),
    HttpClientModule,
    FormsModule,
    ReactiveFormsModule,
    RouterModule.forRoot([
      { path: '', component: HomeComponent, pathMatch: 'full' },
      { path: 'registration', component: ProfileFormComponent },
      { path: 'patients', component: PatientsComponent},
      { path: 'healthcareProviders', component: HealthcareProvidersComponent},
      { path: 'patientUpdate/:id', component: PatientUpdateComponent},
      { path: 'fetch-data', component: FetchDataComponent },
    ])
  ],
  
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
